            WriteLiteral(@"    <p style=""font-family: Arial; font-style:italic; "">
        ""Quando sento no centro da sala de estar e ligo a vitrola, seja no início da manhã de um sábado ou no fim da tarde durante a semana, ou ao chegar do trabalho, preparando o mais recente vinil do Chico Buarque, me surge uma espécie de vontade, como se fosse quase uma possessão de uma entidade que não sabe outra coisa senão apreciar o gosto de café.
        Rapidamente, de prontidão, como se fosse ordenado por um desejo sem controle, preparo: esquento a água numa chaleira, me coloco a procurar o pó preto pelo armário e acrescento. O cheiro que àquele ritual exala acaba por tirar toda a minha família do seu comodismo diário e jogá-la numa espécie de encontro transcendental na sala de estar. A minha esposa desce as escadas sedenta, enfeitiçada pelo cheiro que a fez tirá-la de qualquer coisa mais importante que estivesse fazendo; a minha mãe larga a máquina de costura e surge repentinamente; o meu pai grita da biblioteca, perguntando se já tá pronto,");
            WriteLiteral(@" e o meu irmão mais novo chega me apontando a xícara; enquanto, no fundo, Buarque canta: “ Todo dia, ela diz que é pra eu me cuidar e essas coisas que diz toda mulher. Diz que está me esperando pro jantar e me beija com a boca de café”.
        É aí que cai a ficha, que se percebe que a casa toda foi hipnotizada, foi convocada a sentar na sala, ouvir uma boa música e tomar um bom café. Como se o tempo tivesse parado a si próprio, o meu pai me olha no rosto, o meu irmão me sorri, a minha mãe elogia o ponto do açúcar e a minha esposa me afaga com afeto. Coincidentemente, como se até o disco tivesse sido enfeitiçado, fazendo complô com aquele momento, Buarque canta: “Com açúcar e com afeto, fiz seu doce predileto pra você parar em casa... “ Então, de súbito, respiro e sinto a felicidade, que se trata de momentos únicos, prazerosos, que por mais que dure pouquíssimo tempo até se desejar outra coisa, outro momento, naquele instante nada mais se deseja a não ser estar ali.
        E como se não faltasse mais nada");
            WriteLiteral(@", o meu irmão cita o romantismo de Lord Byron e diz: “Café dá espírito para aqueles que não têm.” Então, tudo pacifica como se fosse uma chuva que molha o mais árido solo; tudo energiza com tanto afeto e se percebe que além do maravilhoso cheiro de café ter retirado todos de sua alcova, ele também reinventa os reencontros familiares, dando novos sentidos, também, às batidas do coração."". - Webester.
    </p>
